INSERT INTO `board_ask` VALUES(13, 'The Natural Solution to Hair Loss, Thinning Hair & Slow-Growing Hair', '&lt;p&gt;\r\n	VIA NATURAL Hair Revitalization for Optimum growth, Strength, Repair and Maintenance&lt;/p&gt;\r\n&lt;p&gt;\r\n	Each Via Natural Revitalization product is designed for a specific hair need. Don&amp;#39;t be a victim to hair loss, thinning hair, or slow growing hair. These are some of the finest products in hair revitalization!&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Cleansing &amp;amp; Preparatory Shampoo&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Stimulationg Gro Serum&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Growth Therapy Conditioner&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Hair Stimulating Gro Creme with &lt;strong&gt;VIACEUTICAL HAIR COMPLEX&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Anti-Itch Growth Treatment Spray&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Daily Maintenance Strengthening Hairdress&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Anti-Breakeage Reparative Strengthening Creme&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '2011-05-06 13:36:17', '<b><font color="orange">hyun</b></font>', 3);
INSERT INTO `board_ask` VALUES(10, 'Via Natural Botanical Styling Gel with Green Tea Extracts', '&lt;p style=&quot;text-align: center;&quot;&gt;\r\n	&lt;u&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(255, 140, 0);&quot;&gt;&lt;b&gt;Condition with Natural Ingredients as You Sculpt and Style Your Hair:&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/u&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;\r\n	&lt;strong&gt;VIA NATURAL Botanical Styling Gel with &lt;span style=&quot;color: rgb(0, 128, 0);&quot;&gt;Green Tea Extracts&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		&lt;strong&gt;Clear Gel&lt;/strong&gt; (Maximum Hold) - Designed specially for styles that require super staying power. &amp;nbsp;Up-do&amp;#39;s, braids, and spikes styles; &lt;strong&gt;Aloe Vera&lt;/strong&gt; and &lt;strong&gt;Ginkgo Bioloba&lt;/strong&gt;, natural antioxidants and tonic for the hair, which hydrates and soothes the scalp.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;background-color: rgb(255, 255, 224);&quot;&gt;&lt;strong&gt;Yellow Gel&lt;/strong&gt; (Soft Hold)&lt;/span&gt; - for those consumers that thermal style their hair needing minimal hold. &amp;nbsp;Ideal for use with curling irons; &lt;strong&gt;Cactus&lt;/strong&gt; and &lt;strong&gt;Avocado Extracts&lt;/strong&gt; add strength and infuses moisture to the hair strands to prevent excessive dryness from thermal styling tools.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;background-color: rgb(230, 230, 250);&quot;&gt;&lt;strong&gt;Purple Gel&lt;/strong&gt; (Normal Hold/Color Treated Hair)&lt;/span&gt; - Designed for color treated hair seals in and protects color vibrancy. &amp;nbsp;Fresh new fragrance; &lt;strong&gt;Blueberry&lt;/strong&gt; and &lt;strong&gt;Lavender Oil&lt;/strong&gt; helps keep the vibrancy of color and provides protection from UV lights.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;background-color: rgb(255, 240, 245);&quot;&gt;&lt;strong&gt;Pink Gel&lt;/strong&gt; (Extra Hold) - &lt;em&gt;&lt;strong&gt;NEW ANTI-ITCH FORMULA &lt;/strong&gt;&lt;/em&gt;&lt;/span&gt;- New formula &lt;strong&gt;contains tea tree oil&lt;/strong&gt;, a natural ingredient that stops itching. &amp;nbsp;A delightful new fragrance enhances the overall appeal of this new formulation; Pomegranate and Rose Oil is for those needing some relief from itching, helps promote strong hair and provides UV protection.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;strong&gt;Protein Gel&lt;/strong&gt; (Firm Hold) - Designed for all textures of hair, especially for those with dreads, locs and twists.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;background-color: rgb(240, 255, 240);&quot;&gt;&lt;strong&gt;Green Gel&lt;/strong&gt; (Moisturizing Gel/Normal Hold)&lt;/span&gt; - is a moisturizing gel for consumers who wear texturizers, ringlets, sprials and body perms. &amp;nbsp;This gel provides style control and moisturization at the same time. &amp;nbsp;Kiwi is a natural moisturizer that infuses moisture into the hair. &amp;nbsp;Olive Oil is an excellent source for shine and for adding strength to the hair.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '2011-05-05 12:05:37', '', 21);
INSERT INTO `board_ask` VALUES(12, 'How to Use WWW', '&lt;p&gt;\r\n	Salon Pro Exclusives 30 Sec WEAVE WONDER WRAP&lt;/p&gt;\r\n&lt;p&gt;\r\n	How to Use:&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;1) Preparation:&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Shampoo and condition the hair with 30 Sec Maintenance Shampoo and Conditioner&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Wrap or mold hair using 30 Sec Weave Molding Gel&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Dry hair completely under a warm dryer;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Proceed to PROCESS STEP&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;2) Process:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		With a tint (hair coloring) brush or comb apply Weave Wonder Wrap (WWW) over the dry, molded hair&lt;/li&gt;\r\n	&lt;li&gt;\r\n		After thoroughly covering the hair with the WWW, dry completely, usually 15-20 minutes, under the dryer&lt;/li&gt;\r\n	&lt;li&gt;\r\n		After thoroughly drying the Weave Wonder Wrap, apply the glue wefts to the &amp;#39;wrap foundation&amp;#39;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Allow glue to dry and proceed to style&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;3) Removal&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Rinse hair with warm water to completely loosen the weave or extension&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Shampoo and proceed to style as usual&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '2011-05-06 13:27:19', '<b><font color="orange">hyun</b></font>', 2);
INSERT INTO `board_ask` VALUES(9, 'Introducing IRIE DREAD Product Line', '&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;font-family: Arial,Verdana,sans-serif; font-size: 12px; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);&quot;&gt;\r\n	&lt;p&gt;\r\n		The name&amp;nbsp;&lt;strong&gt;IRIE DREAD&lt;/strong&gt;&amp;nbsp;is derived from the &amp;quot;Rasta&amp;quot; culture. &amp;nbsp;The name denotes that everything is fine; is okay; is of a good feeling. &amp;nbsp;IRIE DREAD products tells you that &amp;#39;everything is good&amp;#39;; &amp;quot;especially the hair is healthy and looks good&amp;quot;.&lt;/p&gt;\r\n	&lt;div style=&quot;font-family: Arial,Verdana,sans-serif; font-size: 12px; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);&quot;&gt;\r\n		&lt;p&gt;\r\n			IRIE DREAD&amp;nbsp;&lt;strong&gt;Papaya &amp;amp; Passion Fruit Natural Hair Products&lt;/strong&gt;&amp;nbsp;have been formulated with some of the finest ingredients from the Caribbean. &amp;nbsp;These products are ideal to help grow and maintain healthy twists, locks, dreads and other natural hair styles.&lt;/p&gt;\r\n		&lt;p&gt;\r\n			&lt;strong&gt;&lt;u&gt;USES&lt;/u&gt;&lt;/strong&gt;&lt;/p&gt;\r\n		&lt;p&gt;\r\n			IRIE DREAD Papaya &amp;amp; Passion Fruit products have three major uses:&lt;/p&gt;\r\n		&lt;ul&gt;\r\n			&lt;li&gt;\r\n				To begin twists or locks&lt;/li&gt;\r\n			&lt;li&gt;\r\n				To touch-up twists or locks in-between shampoos&lt;/li&gt;\r\n			&lt;li&gt;\r\n				To refresh and maintain locks, twists and other natural styles&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n		&lt;p&gt;\r\n			&lt;u&gt;&lt;strong&gt;PRODUCTS&lt;/strong&gt;&lt;/u&gt;&lt;/p&gt;\r\n		&lt;ul&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Styling Shampoo&lt;/em&gt;: cleanses &amp;amp; hydrates, helps unclog pores, soothe the scalp, rejuvenate and refresh locks &amp;amp; twists&lt;/li&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Creme Locking Wax&lt;/em&gt;: maintain long lasting locks &amp;amp; twists without build-up!&lt;/li&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Firm Locking Wax&lt;/em&gt;: especially for the hair that is wiry and in need of a strong wax to begin and maintain locks &amp;amp; twists. &amp;nbsp;Great for gray hair, too!&lt;/li&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Locking Gel&lt;/em&gt;: for those who prefer gel over wax&lt;/li&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Locking Gel for Resistant Hair&lt;/em&gt;: for resistant or wiry hair&lt;/li&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Anti-Itch Scalp Spray&lt;/em&gt;: reduces itchy scalps, dryness and hair breakage, does NOT cause the styles to &amp;#39;unravel&amp;#39;&lt;/li&gt;\r\n			&lt;li&gt;\r\n				&lt;em&gt;Scalp Oil&lt;/em&gt;: soothes and softens the scalp, strengthens and nourishes the locks &amp;amp; twists, can be used as a &amp;#39;hot oil&amp;#39; treatment when desired !&amp;#39;&amp;quot;&amp;#39;&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;\r\n', '2011-05-04 15:07:54', '<b><font color="orange">hyun</b></font>', 11);
